import React from 'react';
import { View, StyleSheet } from 'react-native';
import { Footer, Home, Navbar } from './component/Navbar';

const App = () => {
    return (
        <View>
            <Navbar />
            <Home />
            <Footer />
        </View>
    );
}

const styles = StyleSheet.create({})

export default App;
